                            <input type="text" style={{width:'100%'}} className="withLabel" name="username" id="form_contentDat_username" value="hector.morales@logicalsoft.co" data-label="cuenta de correo:" disabled="disabled" /> 
                         </div>
                        <div id="divBtnReset" className="divBtnReset" style={{width:'50px'}} data-role="divBtnReset" data-state="enable"> 
                            <button className="save">Continuar</button> 
                        </div>
                        <div data-role="div-empty">
                        </div>
                    </div>
                </div>  				
			  );
  	}
}

export default WindowResetPassword
